import React, { Component } from 'react';
import './VsCode.css';

export default class VsCode extends Component {
  render() {
    return (
      <div className='VsCode'>
        <table className='table-VsCode'>
          <caption><strong>
            developer &gt; src &gt; LeoSchneider.ts
          </strong></caption>
          <tr><td>1</td> <td>&#123;</td> </tr>
          <tr><td>2</td> <td>C</td> </tr>
          <tr><td>3</td> <td>C++</td> </tr>
          <tr><td>5</td> <td>Java</td> </tr>
          <tr><td>6</td> <td>Java</td> </tr>
          <tr><td>7</td> <td>Java</td> </tr>
          <tr><td>8</td> <td>Java</td> </tr>
          <tr><td>9</td> <td>Java</td> </tr>
          <tr><td>10</td> <td>&#125;</td> </tr>
        </table>
      </div>
    )
  }
}
